import * as React from "react";

// importing material UI components
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Button from "@mui/material/Button";

export default function SubHeader(props) {
    // const style = {
    //     background = '#2E3B55',
    // };
    const {status='INIT'} = props
    let s1 = true
    let s2 = true
    let s3 = true
    if(status == 'INIT') {
        s2 = false
        s3 = false
    }
return (
	<AppBar position="static" style={{ background: '#FFFFFF', color: '#0288D1'}}>
		<Toolbar variant="dense">
		<Button disabled = {!s1} color="inherit" sx={{ flexGrow: 1 }}>Generate Random Graph</Button>
		<Button disabled = {!s2} color="inherit" sx={{ flexGrow: 1 }}>Select Algorithm</Button>
		<Button disabled = {!s1} color="inherit" sx={{ flexGrow: 1 }}>Run Algorithm</Button>
		</Toolbar>
	</AppBar>
);
}
